[Form]
public class VendUnsolicitedVendor extends FormRun
{
    VendSearchHelper    vendSearchHelper;
    VendRequestCompany vendRequestCompany;
}

/// <summary>
/// Adds the vendor selected in the vendor search form by the user.
/// </summary>
/// <param name="_dataAreaId">
/// Data area ID of the vendor.
/// </param>
/// <param name="_vendAccount">
/// Vendor account ID of the vendor selected by the user.
/// </param>
public void addVendorFromVendorSearch(DataAreaId _dataAreaId, VendAccount _vendAccount)
{
    #Task

    vendRequestSignup.CompanyInfo = CompanyInfo::findDataArea(_dataAreaId).RecId;
    vendRequestSignup.VendTable = VendTable::findByDataAreaId(_vendAccount, _dataAreaId).RecId;

    element.refreshControls(true);
    element.task(#taskF5);
}

/// <summary>
/// Checks whether the contact can be added for the existing vendor.
/// </summary>
/// <returns>
/// true if the contact can be added for the existing vendor; otherwise false.
/// </returns>
public boolean canCreateContactForExistingVendor()
{
    boolean isEnabled;

    isEnabled = VendRequestSignup.CompanyInfo
                && VendRequestSignup.VendTable
                && !(VendRequestSignup.ContactPerson != 0 || vendRequestCompany.RecId != 0);

    return isEnabled;
}

public void enableControls(VendRequestCompany _vendRequestCompany)
{
    boolean isEnabled = true;

    CreateVendor.enabled(vendRequestSignup.RecId != 0 && vendRequestSignup.ContactPerson == 0);

    CreateContactForExistingVendor.enabled(VendRequestSignup.ContactPerson == 0 && VendRequestSignup.VendTable);

    isEnabled = !(vendRequestSignup.ContactPerson != 0 || _vendRequestCompany.RecId != 0);

    CreateVendorRequest.enabled(isEnabled);
    CompanyInfoReferenceGroup.allowEdit(isEnabled);
    VendTableReferenceGroup.allowEdit(isEnabled && vendRequestSignup.CompanyInfo);
    VendorSearch.enabled(isEnabled);
    CreateContactForExistingVendor.enabled(this.canCreateContactForExistingVendor());
}

public void init()
{
    VendRequestSignup vendRequestSignUpSelectedRecord;

    super();

    if (element.args().caller())
    {
        vendRequestSignUpSelectedRecord = element.args().record();
        vendRequestSignUp_ds.query().dataSourceTable(tablenum(VendRequestSignup)).findRange(fieldnum(VendRequestSignup, RecId)).value(queryValue(vendRequestSignUpSelectedRecord.RecId));

        unsolicitedVendorsList.visible(false);
    }

    vendRequestSignUp_ds.query().dataSourceTable(tablenum(VendRequestSignup)).addRange(fieldnum(VendRequestSignup, AcceptChecked)).value(queryValue(NoYes::Yes));

    vendSearchHelper = new VendSearchHelper();

    this.enableControls(vendRequestCompany);
}

public int active()
{
    int                         ret;

    ret = super();

    vendorAccountNum.text('');
    vendorCompany.text('');
    vendorRequest.text('');

    select firstonly crosscompany recId, AccountNum, VendRequestNumber, DataAreaId, ContactParty
        from vendRequestCompany
            where vendRequestCompany.SignUp == vendRequestSignUp.RecId;

    if (vendRequestCompany.RecId != 0)
    {
        vendorAccountNum.text(vendRequestCompany.AccountNum);
        vendorCompany.text(vendRequestCompany.DataAreaId);
        vendorRequest.text(vendRequestCompany.VendRequestNumber);
        vendRequestSignUp.ContactPerson = ContactPerson::findByPartyRecId(vendRequestCompany.ContactParty).RecId;
    }

    element.enableControls(vendRequestCompany);

    return ret;
}

public void init()
{
    super();
    vendorAccountNum.text('');
    vendorCompany.text('');
    vendorRequest.text('');

    vendRequestSignUp_ds.query().dataSourceTable(tablenum(VendRequestSignup)).addRange(fieldnum(VendRequestSignup, RecId));
}

public Common lookupReference(FormReferenceControl _formReferenceControl)
{
    Common companyInfo;

    changeCompany (CompanyInfo::findRecId(vendRequestSignup.CompanyInfo).DataArea)
    {
        companyInfo = super(_formReferenceControl);
    }

    return companyInfo;
}

void clicked()
{
    Args        args;
    FormRun     formRun;
    Object      formRunObj;

    args = new Args();
    args.name(formStr(VendSearchCriterion));
    args.caller(element);
    args.parm(vendRequestSignUp_Name.text());

    formRun = classfactory.formRunClass(args);
    formRunObj = formRun;

    if (formHasMethod(formRun,'parmSimplifiedSearchCriteria'))
    {
        formRunObj.parmSimplifiedSearchCriteria(true);

        if (vendRequestSignup.CompanyInfo)
        {
            formRunObj.parmDataAreaId(CompanyInfo::findRecId(vendRequestSignup.CompanyInfo).DataArea);
        }
    }

    formRun.run();
    formRun.wait(true);
}
